INSERT INTO `causes` VALUES (1,'Life Events',NULL),(2,'Brain Structure',NULL),(3,'Brain Chemistry','Or Neurochemistry is the study of chemicals, including neurotransmitters and other molecules such as psychopharmaceuticals and neuropeptides, that control and influence the physiology of the nervous system.'),(4,'Hormones','A hormone is a class of signaling molecules in multicellular organisms that are sent to distant organs by complex biological processes to regulate physiology and behavior.'),(5,'Genetics','Genetics, in biology, the science of genes, heredity, and the variation of organisms, and in genetic disorders refer to problems in the gene sequence.'),(6,'Personality',NULL),(7,'Drugs and Medical Treatments',NULL),(8,'Environment',NULL),(9,'Old Parents',NULL),(10,'Pregnancy Problems',NULL),(11,'Exposure to a Traumatic Event',NULL),(12,'Family History','Family History consists of information about disorders of direct blood relatives of the patient.Genealogy typically includes very little of the medical history of the family, but the medical history could be considered a specific subset of the total history of a family.'),(13,'Stress','A feeling of strain and pressure.'),(14,'Childhood Trauma','Childhood trauma is often described as serious adverse childhood experiences. Children may go through a range of experiences that classify as psychological trauma these might include neglect, abandonment, sexual abuse, emotional abuse, physical abuse, witnessing the abuse of a sibling or parent, or having a mentally ill parent.');
