INSERT INTO `symptoms` VALUES (1,'Sadness','Sadness is an emotional pain associated with or characterized by, feelings of disadvantage, loss, despair, grief, helplessness, disappointment, and sorrow. An individual experiencing sadness may become quiet or lethargic, and withdraw themselves from others. An example of severe sadness is depression, a mood that can be brought on by major depressive disorder or persistent depressive disorder. Crying can be an indication of sadness.'),(2,'Irritability','Irritability is the ability that living organisms have to respond to changes in their environment. The term is used for both the physiological reaction to stimuli and for the pathological, abnormal, or excessive sensitivity to stimuli. Irritability can be demonstrated in behavioral responses to both physiological and behavioral stimuli, including environmental, situational, sociological, and emotional stimuli.'),(3,'Loss of Interest','Loss of feeling of pleasure in certain activities that usually bring joy to people.'),(4,'Sleep Disturbances',NULL),(5,'Physical Problems',NULL),(6,'Delusions','A delusion is a false fixed belief that is not amenable to change in light of conflicting evidence. As a pathology, it is distinct from a belief based on false or incomplete information, confabulation, dogma, illusion, hallucination, or some other misleading effects of perception, as individuals with those beliefs are able to change or readjust their beliefs upon reviewing the evidence.'),(7,'Hallucinations','A hallucination is a perception in the absence of an external stimulus that has the qualities of a real perception. Hallucinations are vivid, and substantial, and are perceived to be located in external objective space.Hallucination is a combination of 2 conscious states of brain wakefulness and REM sleep.'),(8,'Disorganized Thinking',NULL),(9,'Abnormal Behavior.','Abnormal behavior is behavior that is out of the ordinary and is not necessarily indicative of a mental or psychological disorder.'),(10,'Negative Symptoms','Negative Symptoms is an individual inability to perform basic, normal functions of living in society, such as logical thinking, self-care, social interaction, and planning..'),(11,'Unstable Feelings',NULL),(12,'Contradictory Behavior','Contradictory Behavior is behavior that goes against each other.'),(13,'Disturbing Thoughts',NULL),(14,'Physical Distress',NULL),(15,'Freeze Response','Freeze Response (also called hyperarousal or the acute stress response) is a physiological reaction that occurs in response to a perceived harmful event, attack, or threat to survival.'),(16,'Repetitive Behavior',NULL),(17,'Difficulties in Social Interaction',NULL),(18,'Impulsivity','Impulsivity (or impulsiveness) is a tendency to act on a whim, displaying behavior characterized by little or no forethought, reflection, or consideration of the consequences.'),(19,'Unstable Relationships',NULL),(20,'Fear of Abandonment',NULL),(21,'Panic or Doom','Panic is a sudden sensation of fear, which is so strong as to dominate or prevent reason and logical thinking, replacing it with overwhelming feelings of anxiety and frantic agitation consistent with an animalistic fight-or-flight reaction.'),(22,'Tired',NULL),(23,'Memory Problem',NULL);
/*!40000 ALTER TABLE `symptoms` ENABLE KEYS */;
UNLOCK TABLES;

