INSERT INTO `treatments` VALUES (1,'Psychotherapy','Psychotherapy - also psychological therapy, talk therapy, or talking therapy - is the use of psychological methods, particularly when based on regular personal interaction, to help a person change behavior, increase happiness, and overcome problems.'),(2,'Psychopharmacology','Psychopharmacology is the scientific study of the effects drugs have on mood, sensation, thinking, behavior, judgment and evaluation, and memory. The field of psychopharmacology studies a wide range of substances with various types of psychoactive properties, focusing primarily on the chemical interactions with the brain.'),(3,'Antipsychotics','Antipsychotics are Drugs which are used for treating symptoms of psychosis such as hallucinations, delusions and disordered thinking.'),(4,'Medications',' Medications is a drug used to diagnose, cure, treat, or prevent disease. Drug therapy (pharmacotherapy) is an important part of the medical field and relies on the science of pharmacology for continual advancement and on pharmacy for appropriate management.'),(5,'Occupational Therapy','Occupational therapy (OT) is a global healthcare profession. It involves the use of assessment and intervention to develop, recover, or maintain the meaningful activities, or occupations, of individuals, groups, or communities. The field of OT consists of health care practitioners trained and educated to improve mental and physical performance.'),(6,' Speech Therapy',' is a field of expertise practiced by a clinician known as a speech-language pathologist (SLP)or a speech and language therapist, both of whom may be referred to as speech therapists. '),(7,'Behaviour Therapy','Behaviour therapy or behavioural psychotherapy is a broad term referring to clinical psychotherapy that uses techniques derived from behaviourism and/or cognitive psychology. It looks at specific, learned behaviours and how the environment, or other peoples mental states, influences those behaviours, and consists of techniques based on behaviorisms theory of learning: respondent or operant conditioning.');
/*!40000 ALTER TABLE `treatments` ENABLE KEYS */;
